import React from 'react'
state = [{
    name: 'camera',
    rate: 4,
    quality: 3
}, {
    name: 'mobile',
    rate: 1,
    quality: 2
}, {
    name: 'laptop',
    rate: 2,
    quality: 1
}, {
    name: 'bike',
    rate: 5,
    quality: 3
}, {
    name: 'guitar',
    rate: 3,
    quality: 3
}];
const addProductReducer = (state = [], action) => {
    switch (action.type) {
        case 'ADD_POST':
            return state.concat([action.data]);
        default:
            return state;
    }
}
export default addProductReducer;
